import React, { Component } from "react";
import CategoryList from "./Containers/CategoryList";
import NavBar from "./Components/NavBar";

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <NavBar />
        <CategoryList />
      </div>
    );
  }
}
